            if ($(this).is(':checked')) {
                $('#inputFieldWrapperPrice').removeClass('hidden');
            } else {
                $('#inputFieldWrapperPrice').addClass('hidden');
            }
        });

        $('#radio-price1').change(function() {
            if ($(this).is(':checked')) {
                $('#inputFieldWrapperPrice').addClass('hidden');
            }
        });
    </script>
</body>
